V8:
TƏCİLİ SATILIR… Həzi Aslanov metrosunun çıxışında (metrodan 40 metr məsafədə);
- 16 mərtəbəli binanın 11-ci mərtəbəsi;
- 90 kv.m., kupçada  82 kv qanuni 2 otaq
- Pol parket, divar kağızı Zambaiti Paratti (avropa istehsalı);
- Pol və tavanın altından səs və temperatur izolyasiyası üçün pinoplast yığılıb;
- Kafel və metlax, santexnika bahalı;
- Kombi İmergass (İtaliya), isti pol;
- Mətbəx və koridor mebeli var;
- Yüksək keyfiyyətli təmir;
- Qaz, su və işıq daimi;
- Binanın həyəti və yeraltı qarajı var;
- Qiymət 125 000 azn 
- Çıxarış (kupça) var.
